      overflow-x: hidden;

      top: 30%;
      width: 100%;

        text-decoration: none;
        color: #fff;
        display: block;
        transition: 0.4s;
    }

        -webkit-text-stroke-width: 1px;
        -webkit-text-stroke-color: white;
        margin: 0;
    }

      -webkit-text-fill-color: black; 
        -webkit-text-stroke-width:1px;

    }
